import React from 'react'

function ProjectItem({key, project}) {
    const dateString = new Date(project.startDate)
    return (
            <tr>
                <th scope="row">{key}</th>
                <td>{project.projectName}</td>
                <td>{dateString.toDateString()}</td>
                <td>{}</td>
            </tr>
    )
}

export default ProjectItem
